import React from 'react';

const style={
    div:{
        position:'relative',
        display:'flex'
    },
    year:{
        position:'absolutez'
    },
    line:{
        zIndex:'2',
        position:'absolute',
        borderLeft:"6px solid #0688FA",
        height:'100%',
        marginLeft:"10px"
    },
    icon:{
        position:'absolute',
        zIndex:3
    },
    content:{
        position:"absolute"
    }      
}
export default function TimelineCard({iconURL,year,content}){
    return(
        <div className="row flex-nowrap">

            <p style={style.year}className="pl-2 pr-2">{year} </p>

            <div>
                <div 
                    style={style.div} 
                    className='m-0 p-0 h-100'>

                        <img style={style.icon}className='u-icon u-icon--md' src={iconURL} alt='icon' />
                        <span style={style.line}>{" "}</span>


                </div>

            </div>

                <p style={style.content}>
                    {content}
                </p>

        </div>
    )
}
